import React from "react";

function Card (props) {
    return <div>
    <dl className="dictionary">
        <div className="term">
            <dt>
            <span className="emoji">
                {props.emoji}
            </span>
            <span> {props.name} </span>
            </dt>
            <dd>
            {props.meaning}
            </dd>
        </div>
    </dl>
  </div>
}

export default Card;
